var vSignup=new Vue({el:"#login",data:{messages:[],amount:"",title:"",lname:"",fname:"",email:"",mobile:""},computed:{isValid:function(){return!this.errors.any()&&""!=this.amount&&""!=this.title&&""!=this.lname&&""!=this.fname&&""!=this.email&&""!=this.mobile}},methods:{onSubmit:function(){if(!this.errors.any()){this.$http.post("/api/posts",this.$data).then(function(t){document.location.href="/first-login"},function(t){404==t.status?this.messages.push({type:"error",message:"Page Not Found: "+t.url}):this.messages.push({type:"error",message:t.message})})}}}});